if (!$binary || !$binary.data || !$binary.data.data) {
    return [
        { json: $json } // pass the item along without changes
    ];
}


// Convert binary Buffer to string
const fileContent = $binary.data.data.toString('utf8');

// Parse JSON safely
let parsedContent;
try {
    parsedContent = JSON.parse(fileContent);
} catch (err) {
    throw new Error('File is not valid JSON: ' + err.message);
}

// Return parsed JSON
return [
    { json: parsedContent }
];
